B.FB=new A.ff("\xbfPor qu\xe9 yo?","SELECTIVO Y SINCERO\nSer el encargado de tu marca requiere compromiso y responsabilidad, es por eso que antes de comenzar analizar\xe9 tu negocio con mucho detalle para concluir si cumples con todos los requerimientos para poder apoyarte.\n\nEn caso de ser un S\xcd pondremos un plan de acci\xf3n eficaz.\n\nEn caso de ser un NO te dar\xe9 mi feedback sincero para referirte con el especialista o plan que tu negocio necesite.\n\nPRECIO SEG\xdaN TU MODELO DE NEGOCIO\nAlgo que me caracteriza es que reviso muy a detalle tu negocio antes de comenzar e incluso evaluando en conjunto contigo puedo saber si est\xe1s preparado para dar este paso.\n\nMi promesa es que cuando adquieras mi servicio sea un gran alivio y veas resultados.\n\nEXPERIENCIA Y RESULTADOS\nDesde la creaci\xf3n de la estrategia, copywriting, anuncios creativos, segmentaci\xf3n, funnels de conversi\xf3n de tu web, manejo de presupuesto y an\xe1lisis de resultados est\xe1n dentro de mis capacidades para ocupar este puesto",null)
B.Fz=new A.ff("Preguntas frecuentes","\xbfCu\xe1l es el costo promedio para que seas el encargado de la publicidad de mi negocio?\nEl precio comienza desde los $4000 en adelante, depende de muchos factores y los objetivos que tengas como negocio es por eso que me tomo el tiempo de analizar previamente y saber si puedo asumir el proyecto.\n\n\xbfVer\xe9 resultados de inmediato?\nEsta pregunta es muy com\xfan, y esto depende de como est\xe1 plasmada la estrategia, tu producto, precio y valor percibido por tu audiencia.\n\nLa respuesta correcta es que me encargar\xe9 de que impactes a tu p\xfablico objetivo de una manera inteligente.\n\nUna vez rellene el formulario \xbfQu\xe9 suceder\xe1?\nEn el transcurso de  2 a 3 d\xedas me comunicar\xe9 contigo para darte todos los detalles y tendremos una reuni\xf3n que durar\xe1 30 minutos para entender tus necesidades y n\xfameros al 100%.",null)
B.Rd=A.a(s([B.Fs,B.y,B.Fw,B.y,B.Fu,B.y,B.FB,B.y,B.Fz]),t.p)
