B.FD=new A.ff("Preguntas frecuentes","\xbfDebo tener un presupuesto alto para invertir en mis campa\xf1as?\nEsto es muy relativo y depende de tu producto o servicio, lo que si tienes que tener en cuenta es que como m\xednimo tengas $1000 USD para poder hacer la mayor cantidad de pruebas y hagamos un buen an\xe1lisis de resultados durante este tiempo.\n\nEntiendo gran parte pero quiero m\xe1s detalles\nC\xf3mo este servicio es especializado, tendremos una videollamada de 20 minutos para saber si tu negocio est\xe1 preparado y comprometido.\nEn la llamada te explicar\xe9 m\xe1s a detalle todas tus dudas.\n\n\xbfCu\xe1l es el precio de la mentor\xeda intensiva?\nEl precio ronda entre los $6000 -$12.000 USD depende de m\xfaltiples factores que estaremos conversando en la video llamada.\n\nNo es una pregunta, quiero que seas mi mentor!\nCalma, primero conversemos y veamos si est\xe1s preparado y tienes los requisitos, si est\xe1s leyendo esto, ya tienes el primero: Ganas.",null)
